" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Marked honeycombing in IPF",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 376px; height: 280px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     Usual interstitial pneumonia pattern with marked honeycombing and traction bronchiectasis in both lower lobes along with an absence of ground glass changes. The peripheral regions of the lower lobes and middle lobe are typically involved, initially sparing the central parts of the lower lobes.",
"    </p>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
