var title_f41_35_42556="US prehospital provider scope of practice";
var content_f41_35_42556=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F83593&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F83593&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    United States responder and emergency medical technician scope of practice",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Provider (current designation)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Provider (future designation)*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Scope of practice",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        First responder",
"       </td>",
"       <td>",
"        Emergency medical responder (EMR)",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Ensure environment is safe to enter and provide care",
"         </li>",
"         <li>",
"          Gather initial history",
"         </li>",
"         <li>",
"          Appropriate physical examination",
"         </li>",
"         <li>",
"          Remove patient(s) from immediate danger",
"         </li>",
"         <li>",
"          Basic cardiopulmonary resuscitation",
"         </li>",
"         <li>",
"          Operate an automated external defibrillator",
"         </li>",
"         <li>",
"          Oxygen administration",
"         </li>",
"         <li>",
"          Insert oropharyngeal airway",
"         </li>",
"         <li>",
"          Suction airway",
"         </li>",
"         <li>",
"          Provide bag-mask ventilation",
"         </li>",
"         <li>",
"          Apply direct pressure for control of bleeding",
"         </li>",
"         <li>",
"          Administer unit dose auto-injectors (eg, epinephrine)",
"         </li>",
"         <li>",
"          Perform bandaging",
"         </li>",
"         <li>",
"          Provide manual C-spine and fracture stabilization",
"         </li>",
"         <li>",
"          Assist uncomplicated delivery of newborn",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Emergency medical technician-Basic (EMT-B)",
"       </td>",
"       <td>",
"        Emergency medical technician (EMT)",
"       </td>",
"       <td>",
"        As for first responder and:",
"        <ul>",
"         <li>",
"          Obtain consent for or refusal of care",
"         </li>",
"         <li>",
"          Perform basic on-scene triage",
"         </li>",
"         <li>",
"          Access and extricate trapped victims",
"         </li>",
"         <li>",
"          Apply traction splint",
"         </li>",
"         <li>",
"          Perform spine immobilization (C-spine and backboard)",
"         </li>",
"         <li>",
"          Apply tourniquet",
"         </li>",
"         <li>",
"          Apply pneumatic antishock garment if indicated",
"         </li>",
"         <li>",
"          Irrigate eyes",
"         </li>",
"         <li>",
"          Provide basic burn management",
"         </li>",
"         <li>",
"          Perform basic poisoning management (administration of activated charcoal)",
"         </li>",
"         <li>",
"          Assist patient in taking their own prescribed medications (eg, nitroglycerin SL)",
"         </li>",
"         <li>",
"          Administer limited types of oral medications (eg, aspirin, glucose paste)",
"         </li>",
"         <li>",
"          Assist complicated delivery of newborn",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Emergency medical technician-Intermediate (EMT-I)",
"       </td>",
"       <td>",
"        Advanced emergency medical technician (AEMT)",
"       </td>",
"       <td>",
"        As for first responder, EMT-B and:",
"        <ul>",
"         <li>",
"          Insert esophageal-tracheal or multi-lumen airway",
"         </li>",
"         <li>",
"          Suction already intubated patients",
"         </li>",
"         <li>",
"          Obtain peripheral IV access",
"         </li>",
"         <li>",
"          Perform IO access",
"         </li>",
"         <li>",
"          Administer IV fluids",
"         </li>",
"         <li>",
"          Administer limited medications (eg, nitroglycerine SL, IM or SC epinephrine, IV dextrose, IM or IV naloxone)",
"         </li>",
"         <li>",
"          Administer inhaled beta agonists",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     C-spine: cervical spine; SL: sublingual; IO: intraosseous; IV: intravenous; IM: intramuscular; SC: subcutaneous.",
"     <br/>",
"     * Proposed in United States document, EMS Education Agenda for the Future: A Systems Approach (www.nhtsa.gov/people/injury/ems/FinalEducationAgenda.pdf [Accessed on May 08, 2012]).",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f41_35_42556=[""].join("\n");
var outline_f41_35_42556=null;
var title_f41_35_42557="TNM stage Merkel";
var content_f41_35_42557=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F75213&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F75213&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    TNM staging system for Merkel cell carcinoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Primary tumor (T)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        TX",
"       </td>",
"       <td colspan=\"3\">",
"        Primary tumor cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T0",
"       </td>",
"       <td colspan=\"3\">",
"        No evidence of primary tumor (eg, nodal/metastatic presentation without associated primary)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tis",
"       </td>",
"       <td colspan=\"3\">",
"        In situ primary tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T1",
"       </td>",
"       <td colspan=\"3\">",
"        Less than or equal to 2 cm maximum tumor dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2",
"       </td>",
"       <td colspan=\"3\">",
"        Greater than 2 cm but not more than 5 cm maximum tumor dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3",
"       </td>",
"       <td colspan=\"3\">",
"        Over 5 cm maximum tumor dimension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T4",
"       </td>",
"       <td colspan=\"3\">",
"        Primary tumor invades bone, muscle, fascia, or cartilage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Regional lymph nodes (N)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        NX",
"       </td>",
"       <td colspan=\"3\">",
"        Regional lymph nodes cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N0",
"       </td>",
"       <td colspan=\"3\">",
"        No regional lymph node metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        cN0",
"       </td>",
"       <td colspan=\"3\">",
"        Nodes negative by clinical exam* (no pathologic node exam performed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        pN0",
"       </td>",
"       <td colspan=\"3\">",
"        Nodes negative by pathologic exam",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        N1",
"       </td>",
"       <td class=\"sublist_other_start\" colspan=\"3\">",
"        Metastasis in regional lymph node(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        N1a",
"       </td>",
"       <td class=\"sublist_other\" colspan=\"3\">",
"        Micrometastasis&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        N1b",
"       </td>",
"       <td class=\"sublist_other\" colspan=\"3\">",
"        Macrometastasis&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N2",
"       </td>",
"       <td colspan=\"3\">",
"        In transit metastasis&loz;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Distant metastasis (M)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M0",
"       </td>",
"       <td colspan=\"3\">",
"        No distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        M1",
"       </td>",
"       <td class=\"sublist_other_start\" colspan=\"3\">",
"        Metastasis beyond regional lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        M1a",
"       </td>",
"       <td class=\"sublist_other\" colspan=\"3\">",
"        Metastasis to skin, subcutaneous tissues or distant lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        M1b",
"       </td>",
"       <td class=\"sublist_other\" colspan=\"3\">",
"        Metastasis to lung",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        M1c",
"       </td>",
"       <td class=\"sublist_other\" colspan=\"3\">",
"        Metastasis to all other visceral sites",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Anatomic stage/prognostic groups&sect;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage 0",
"       </td>",
"       <td>",
"        Tis",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IA",
"       </td>",
"       <td>",
"        T1",
"       </td>",
"       <td>",
"        pN0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IB",
"       </td>",
"       <td>",
"        T1",
"       </td>",
"       <td>",
"        cN0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IIA",
"       </td>",
"       <td>",
"        T2/T3",
"       </td>",
"       <td>",
"        pN0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IIB",
"       </td>",
"       <td>",
"        T2/T3",
"       </td>",
"       <td>",
"        cN0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IIC",
"       </td>",
"       <td>",
"        T4",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IIIA",
"       </td>",
"       <td>",
"        Any T",
"       </td>",
"       <td>",
"        N1a",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IIIB",
"       </td>",
"       <td>",
"        Any T",
"       </td>",
"       <td>",
"        cN1/N1b/N2",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stage IV",
"       </td>",
"       <td>",
"        Any T",
"       </td>",
"       <td>",
"        Any N",
"       </td>",
"       <td>",
"        M1",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Note: cTNM is the clinical classification, pTNM is the pathologic classification.",
"    <div class=\"footnotes\">",
"     * Clinical detection of nodal disease may be via inspection, palpation, and/or imaging.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Isolated tumor cells in a lymph node are classified as micrometastases (N1a) and the presence of isolated tumor cells recorded using the prognostic factor. Micrometastases are diagnosed after sentinel or elective lymphadenectomy.",
"      <br>",
"       &Delta; Macrometastases are defined as clinically detectable nodal metastases confirmed by therapeutic lymphadenectomy or needle biopsy.",
"       <br>",
"        <span class=\"lozenge\">",
"         &loz;",
"        </span>",
"        In transit metastasis: a tumor distinct from the primary lesion and located either between the primary lesion and the draining regional lymph nodes or distal to the primary lesion.",
"        <br>",
"         &sect; Patients with primary Merkel cell carcinoma with no evidence of regional or distant metastases (either clinically or pathologically) are divided into two stages: Stage I for primary tumors &le;2 cm in size and Stage II for primary tumors &gt;2 cm in size. Stages I and II are further divided into A and B substages based on method of nodal evaluation. Patients who have pathologically proven node negative disease (by microscopic evaluation of their draining lymph nodes) have improved survival (substaged as A) compared to those who are only evaluated clinically (substaged as B). Stage II has an additional substage (IIC) for tumors with extracutaneous invasion (T4) and negative node status regardless of whether the negative node status was established microscopically or clinically. Stage III is also divided into A and B categories for patients with microscopically positive and clinically occult nodes (IIIA) and macroscopic nodes (IIIB). There are no subgroups of Stage IV Merkel cell carcinoma.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Used with the permission of the American Joint Committee on Cancer (AJCC), Chicago, Illinois. The original source for this material is the AJCC Cancer Staging Manual, Seventh Edition (2010) published by Springer New York, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
